from collections import Counter

def isValid(s):
    if len(s) <= 2:
        return "YES"
    # Write your code here
    dic = Counter(s)
    dicValues = Counter(dic.values())    
    if len(dicValues) == 1:
      return "YES"
    
    keys = list(dicValues.keys())
    
    if len(keys) > 2:
        return "NO"
    
    if dicValues[keys[0]] >1 and dicValues[keys[1]]>1:
        return "NO" 
    
    if 1 in keys and dicValues[1] == 1:
      return "YES"
    
    
    one = keys[0] if dicValues[keys[0]] == 1 else keys[1]
    big = keys[1] if one == keys[0] else keys[0]
    
    if one - big == 1:
      return "YES"
    
    return "NO" 
    
    
